import React from "react";
import {
    StyleSheet,
    Text,
    View,
    Image,
    TextInput,
    Button,
    Alert,
    Switch,
    Linking,
  } from "react-native";

function MainImage({ source }) {
  return (
    <Image
      className="w-64 h-64 rounded-lg border-teal-400 border-2 shadow-teal-500 shadow-2xl my-5"
      source={source}
    />
  );
}

export default MainImage;
